export const patch = async (url, data) => {
  return await axios
    .patch(url, data)
    .then((res) => {
      if (res.status === 200) {
        if (res.data?.success) {
          return res.data?.data.list ? res.data?.data.list : res.data;
        } else {
          return [];
        }
      } else {
        return [];
      }
    })
    .catch((err) => {
      // return err?.response?.data;
    });
};

export const post = async (url, data) => {
  return await axios
    .post(url, data)
    .then((res) => {
      if (res.status === 200) {
